<script lang="ts" setup>
import { nextTick, onMounted, ref } from 'vue'
import { CXMT_MAP } from '@/class/map';
import { throttle } from 'lodash-es';
import { CloseOutlined } from '@ant-design/icons-vue';
import { Point, Map } from './map';
const items = ref<Map[]>(CXMT_MAP);
const mapRef = ref<HTMLElement>();
let location = ref<Point>(null);
const trigger = (item) => {
    location.value = null;
    item.checked = !item.checked;
    item.checked ? item.$refs.forEach((element: HTMLElement) => {
        element.classList.add('ready')
        nextTick(() => element.classList.add('checked'))
    }) : item.$refs.forEach((element: HTMLElement) => element.classList.remove('checked', 'ready'));
}

onMounted(() => {
    items.value.map((item) => {
        item.$refs = [].slice.call(mapRef.value.querySelectorAll(item.points.map(v => `g[name="${v.name}"]`).join(',')), 0)
        return item;
    })
    initTouchScroll(mapRef.value);

})
const initTouchScroll = (ele: HTMLElement) => {
    let pos = { top: 0, left: 0, x: 0, y: 0 };
    const mouseDownHandler = throttle((e) => {
        ele.style.cursor = 'grabbing';
        ele.style.userSelect = 'none';

        pos = {
            left: ele.scrollLeft,
            top: ele.scrollTop,
            // Get the current mouse position
            x: e.clientX,
            y: e.clientY,
        };

        document.addEventListener('mousemove', mouseMoveHandler);
        document.addEventListener('mouseup', mouseUpHandler);
    });

    const mouseMoveHandler = throttle(function (e) {
        // How far the mouse has been moved
        const dx = e.clientX - pos.x;
        const dy = e.clientY - pos.y;

        // Scroll the element
        ele.scrollTop = pos.top - dy;
        // ele.scrollLeft = pos.left - dx;
    });

    const mouseUpHandler = throttle(function () {
        ele.style.cursor = 'grab';
        ele.style.removeProperty('user-select');

        document.removeEventListener('mousemove', mouseMoveHandler);
        document.removeEventListener('mouseup', mouseUpHandler);
    });

    // Attach the handler
    ele.addEventListener('mousedown', mouseDownHandler);
}
</script>
